import './App.css';

import {useState} from 'react';

function App() {

  const [number,setNumber] = useState(0);
  return (
    <div className='App' >
      <h1>{number}</h1>
      <button onClick={() => setNumber(number +1 )}></button>
    </div>
  );
}

export default App;
